import React, { Component } from "react";

class Home extends Component {
  constructor(props) {
    super(props);
    this.imgVar = require("./images/logo.jpg");
  }

  render() {
    return (
      <React.Fragment>
        <img src={imgVar} />
      </React.Fragment>
    );
  }
}

export default Home;
